An instance of <a href="http://sw.opencyc.org/concept/Mx4rn9jaQlzFQdiCbbYcxEkVsQ" class="cyc_term">IRExpansionPredicate</a>, used to generate expansion suggestions from a partial understanding of an NL utterance.  Given a context in which an information retrieval parsing engine has produced a parse of some natural language utterance UTTERANCE such that: 
1 the verb of UTTERANCE denotes some (possibly non-proper) specialization SPEC of some type of situation SITUATION-TYPE;
2 a sub-string SUBSTRING of UTTERANCE is co-referential with the <a href="http://sw.opencyc.org/concept/Mx4rwQf_-5wpEbGdrcN5Y29ycA" class="cyc_term">CycLTerm</a> TERM (that is, they share the same denotation, DENOTATION);
3 the semantics of UTTERANCE are understood at least well enough to know they involve DENOTATION playing a role SPECIALIZED-ROLE in some (or perhaps every) instance of SPEC, where SPECIALIZED-ROLE is a (possibly non-proper) specialization or inverse-specialization of the role ROLE;
then (<a href="http://sw.opencyc.org/concept/Mx4rhFixbmDIQdieHP-jq3k_hg" class="cyc_term">irExpansionSentencesForTermGivenVerbSem</a> TERM SITUATION-TYPE ROLE SENTENCE) says that the <a href="http://sw.opencyc.org/concept/Mx4rvViAoJwpEbGdrcN5Y29ycA" class="cyc_term">CycLSentence</a> SENTENCE is an appropriate sentence from which to generate expansion strings for SUBSTRING.  For example, (<a href="http://sw.opencyc.org/concept/Mx4rhFixbmDIQdieHP-jq3k_hg" class="cyc_term">irExpansionSentencesForTermGivenVerbSem</a> <font color="#ff0000">#$Bailey</font> <a href="http://sw.opencyc.org/concept/Mx4rvViIKZwpEbGdrcN5Y29ycA" class="cyc_term">FeedingEvent</a> <a href="http://sw.opencyc.org/concept/Mx4rwCmciZwpEbGdrcN5Y29ycA" class="cyc_term">patient_Generic</a> (<a href="http://sw.opencyc.org/concept/Mx4rvVkLIZwpEbGdrcN5Y29ycA" class="cyc_term">massOfObject</a> <font color="#ff0000">#$Bailey</font> (<a href="http://sw.opencyc.org/concept/Mx4rvVkLYZwpEbGdrcN5Y29ycA" class="cyc_term">Pound_UnitOfMass</a> 22))) says that (<a href="http://sw.opencyc.org/concept/Mx4rvVkLIZwpEbGdrcN5Y29ycA" class="cyc_term">massOfObject</a> <font color="#ff0000">#$Bailey</font> (<a href="http://sw.opencyc.org/concept/Mx4rvVkLYZwpEbGdrcN5Y29ycA" class="cyc_term">Pound_UnitOfMass</a> 22)) is an appropriate <a href="http://sw.opencyc.org/concept/Mx4rvViAoJwpEbGdrcN5Y29ycA" class="cyc_term">CycLSentence</a> from which to generate an expansion string for any string (e.g., &quot;my dog&quot;) that is coreferential with <font color="#ff0000">#$Bailey</font> in the context of a partial parse of an NL sentence (e.g., &quot;How much should I feed my dog?&quot;, &quot;How often should I feed my dog?&quot;, &quot;What can I feed my dog?&quot;) for which we know that <a href="http://sw.opencyc.org/concept/Mx4rvViIKZwpEbGdrcN5Y29ycA" class="cyc_term">FeedingEvent</a> is a collection in the upward <a href="http://sw.opencyc.org/concept/Mx4rvViBDpwpEbGdrcN5Y29ycA" class="cyc_term">genls</a> closure of whatever collection is denoted by the verb, and for which the term <font color="#ff0000">#$Bailey</font> is understood to be playing the role <a href="http://sw.opencyc.org/concept/Mx4rwCmciZwpEbGdrcN5Y29ycA" class="cyc_term">patient_Generic</a> in that collection.
